import {Typography,Container,Grid} from '@material-ui/core';
import useStyles from "./styles"
import header from "./header.svg"

const AdminHeader = () => {
    const classes = useStyles();
    return (
        <>
        <Container style={{display:"flex"}}>
            <Grid container xs={12}>
                <Grid item xs={6}>
                {/* <Typography variant="h2" component="h2" style={{textAlign:"center",width:"100%"}}>Welcome to Foodify</Typography> */}
                </Grid>
                <Grid item xs={6}>
                    <img 
                        src={header} 
                        style={{
                            width:"3000px",
                            height:"400px",
                            margin:"20px"

                        }}
                        alt="Hero img"
                        />
                </Grid>
            </Grid>
      
        
        </Container>

        </>
    )
}

export default AdminHeader
